import React, { useState, useContext } from "react";
import { ThemeContext } from "../../context/Theme";

const DataTable = ({ accvalues, setSelected }) => {
  const [searchTerm, setSearchTerm] = useState("");
  const [currentPage, setCurrentPage] = useState(1);
  const rowsPerPage = 5;
  const [theme] = useContext(ThemeContext);

  // Theme-based styles
  const textColor = theme === "night" ? "text-white" : "text-black";
  const bgColor = theme === "night" ? "bg-night" : "bg-fantasy";
  const headerColor = theme === "night" ? "bg-gray-800" : "bg-gray-200";

  // Filter data based on search term
  const filteredData = accvalues.filter((row) => {
    const { username, email, date, status } = row;
    return (
      username.toLowerCase().includes(searchTerm.toLowerCase()) ||
      email.toLowerCase().includes(searchTerm.toLowerCase()) ||
      date.toLowerCase().includes(searchTerm.toLowerCase()) ||
      status.toLowerCase().includes(searchTerm.toLowerCase())
    );
  });

  // Pagination logic
  const totalPages = Math.ceil(filteredData.length / rowsPerPage);
  const paginatedData = filteredData.slice(
    (currentPage - 1) * rowsPerPage,
    currentPage * rowsPerPage
  );

  return (
    <div
      className={`flex col-span-8 overflow-hidden rounded-lg shadow-lg text-xs md:text-md w-64 px-8 sm:w-full py-10 mb-5 ${bgColor} ${textColor}`}
    >
      <div className="p-6 w-full">
        {/* Container for header and Add Account button */}
        <div className="flex justify-between mb-4">
          <h2 className="font-bold text-xl">Admin Accounts</h2>
          {/* Add Account Button */}
          <button
            onClick={() => setSelected("AddAccount")}
            className="bg-blue-500 text-white font-bold py-2 px-4 rounded hover:bg-blue-700"
          >
            + Add Account
          </button>
        </div>

        {/* Search Input */}
        <div className="w-full sm:w-full p-1 py-1 px-7 mb-4 sm:mb-0">
          <div className="flex items-center border rounded-md w-full">
            <input
              type="text"
              placeholder="Search..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              className="p-2 w-full rounded-l-md outline-none"
            />
            {/* Search Icon on the right */}
            <i className="fa-solid fa-magnifying-glass p-2"></i>
          </div>
        </div>

        {/* Table */}
        <div className="flex justify-center">
          <table className="table-auto w-full mt-8 text-center">
            <thead>
              <tr className={`${headerColor}`}>
                <th className="px-4 py-2">Action</th>
                <th className="px-4 py-2">Username</th>
                <th className="px-4 py-2">Email</th>
                <th className="px-4 py-2">Date Created</th>
                <th className="px-4 py-2">Status</th>
              </tr>
            </thead>
            <tbody>
              {paginatedData.length > 0 ? (
                paginatedData.map((item) => (
                  <tr
                    key={item.id}
                    className="hover:bg-gray-100 dark:hover:bg-gray-700"
                  >
                    <td className="px-4 py-2">
                      <button
                        onClick={() => setSelected("Receipt")}
                        className="hover:text-blue-700 font-bold py-2 px-4 rounded"
                      >
                        <i className="fa-solid fa-eye"></i>
                      </button>
                    </td>
                    <td className="px-4 py-2">{item.username}</td>
                    <td className="px-4 py-2">{item.email}</td>
                    <td className="px-4 py-2">{item.date}</td>
                    <td className="px-4 py-2">{item.status}</td>
                  </tr>
                ))
              ) : (
                <tr>
                  <td colSpan="5" className="text-center py-4">
                    No results found.
                  </td>
                </tr>
              )}
            </tbody>
          </table>
        </div>

        {/* Pagination */}
        <div className="flex justify-end mt-5">
          <div className="flex items-center">
            <button
              className="py-2 px-4 mr-2"
              disabled={currentPage === 1}
              onClick={() => setCurrentPage((prev) => prev - 1)}
            >
              &lt;
            </button>
            <span className="py-2 px-4">{currentPage}</span>
            <button
              className="py-2 px-4 ml-2"
              disabled={currentPage === totalPages}
              onClick={() => setCurrentPage((prev) => prev + 1)}
            >
              &gt;
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default DataTable;
